INSERT INTO `wp_postmeta` VALUES ('300', '712', '_et_pb_old_content', 'On the 18<sup>th</sup> of September local children’s home, Heaven’s Nest will officially launch their newly built classroom.  Heaven’s Nest is an emergency foster home for children under the age of 8 that have been abused, abandoned, neglected or are affected by HIV &amp; AIDS. “Many of the children that we take in have had no exposure to even basic education. This means that when they were sent to school in the past, they were often unprepared for it,” says Eleanor Bester, the coordinator at Heaven’s Nest.\n\nHeaven’s Nest aims to provide holistic care for children in need. Bester spotted the need for a classroom on their property to add to the loving, safe home, healthy food, medical care, counselling and play therapy already provided.\n\n“It is about changing the children’s mindset,” Bester explains. “They need to learn the feeling of leaving home and going to school. In the morning, they get their things together and get taken across to the classroom; it gives them a sense of pride in going to school. They now have three unique areas, the home, the school and the playground.”\n\nThe classroom project was completed with the help of a few key sponsors, including Grinaker Construction, an Australian sponsor, Simone Sherman, Premier Stationers and two volunteer retired teachers who will be donating their time and their knowledge to teach the children.\n\nBishop Mervyn Castle of the False Bay Diocese, a key supporter of Heaven’s Nest, will be officially opening the classroom on the 18<sup>th</sup>. This will be followed by a celebration which will include magicians from theCollege ofMagic performing for the children.\n\nIf you would like to get involved with helping Heaven’s Nest; there are many ways to do so. Please call US on (021) 703 9781; email her on <a href="mailto:heavensnest@telkomsa.net">heavensnest@telkomsa.net</a>or see <a href="http://www.heavensnest.org.za/?page_id=14">here .</a>\n\n<strong>About Heaven’s Nest</strong>\n\n<strong>Heaven’s Nest</strong>, a children’s centre situated in Ottery, was opened in 2004 and is run by the task team of St Francis ofAssisi in Strandfontein. Their mission is to be a safe place of care and nurturing for some of the projected millions of orphans to emerge from the HIV/AIDS pandemic and other “children in need”.\n<div class="clear"></div>'); 
